	add("doobie", "{\"term\":\"doobie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin unknown.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marijuana cigarette; a joint\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, \u0026quot;An altered state\u0026quot;, \u0027The Economist\u0027, 14 Oct 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In parts of the state, enjoying an occasional \u0027\u0027doobie\u0027\u0027 is nowadays considered little different from sipping a Pinot Noir\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, \u0026quot;Classic Dave Barry\u0026quot;, 20 Apr 2012\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"… [The] atmosphere … was one part oxygen, four parts nitrogen, and seventeen parts \u0027\u0027doobie\u0027\u0027 vapor\", \"priority\":5}]}, \"synonyms\":{}}");

	add("doodle", "{\"term\":\"doodle\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"Influenced by \u0027\u0027 from German \u0027dudeln\u0027 (lang\u003dde) from \u0027dudel\u0027 (lang\u003dde) from Czech or Polish \u0027dudy\u0027 (lang\u003dcs) The word doodle first appeared in the early 17th century to mean a fool or simpleton. German variants of the etymon include Dudeltopf, Dudentopf, Dudenkopf, Dude and Dödel. American English \u0027dude\u0027 may be a derivation of \u0027doodle\u0027.The meaning \u0026quot;fool, simpleton\u0026quot; is intended in the song title \u0026quot;Yankee Doodle\u0026quot;, originally sung by British colonial troops prior to the American Revolutionary War. This is also the origin of the early eighteenth century verb to doodle, meaning \u0026quot;to swindle or to make a fool of\u0026quot;. The modern meaning emerged in the 1930s either from this meaning or from the verb \u0026quot;to dawdle\u0026quot;, which since the seventeenth century has had the meaning of wasting time or being lazy.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fool, a simpleton, a mindless person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1764\u0027\u0027, Samuel Foote, \u0027The Mayor of Garrett\u0027, W. Lowndes (1797), [http://books.google.com/books?id\u003d52xMAAAAcAAJ\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22doodle,+jackanapes%22 page 43\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Mrs. Sneak\u0027. Why \u0027\u0027doodle\u0027\u0027! jackanapes! harkee, who am I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sneak\u0027. Come, don\u0027t go to call names: am I? vhy my vife, and I am your master\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1812\u0027\u0027, \u0026quot;THE TEARS OF SIR VICARY!!!\u0026quot;\u0026lt;!-- The title is in allcaps in the source. --\u0026gt;, \u0027The Scourge\u0027, 2 March 1812, [http://books.google.com/books?id\u003doLIPAAAAQAAJ\u0026amp;pg\u003dPA231 page 231\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Perceval\u0027. Weep on! weep on! thou flouted loon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Weep on! weep on! thou gowky \u0027\u0027doodle\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1837\u0027\u0027, \u0026quot;Carmen Inaugurale\u0026quot;, \u0027Tait\u0027s Edinburgh Magazine\u0027, November 1837, [http://books.google.com/books?id\u003dzkIFAAAAQAAJ\u0026amp;pg\u003dPA676\u0026amp;dq\u003d%22doodle%22\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doodle%22\u0026amp;f\u003dfalse page 676\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Courtier, it was thine to bow\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Great Arthur he, and \u0027\u0027Doodle\u0027\u0027 thou\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A small mindless sketch, etc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Penis\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Patti Walkuski, \u0027No Bed of Roses: Memoirs of a Madam\u0027, Wakefield Press (1993), ISBN 9781862543102, [http://books.google.com/books?id\u003dP_Y5OaizWREC\u0026amp;pg\u003dPA189\u0026amp;dq\u003d%22his+doodle%22 page 189\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"His \u0027\u0027doodle\u0027\u0027 hung as limp as last month\u0027s celery\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Jane Bonander, \u0027Winter Heart\u0027, Pocket Star Books (1996), ISBN 9780671529826, [http://books.google.com/books?id\u003dWBQ1vBiDaSsC\u0026amp;q\u003d%22his+doodle%22\u0026amp;dq\u003d%22his+doodle%22 page 43\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Her favorite had been when she\u0027d convinced the lascivious guards that Dinah\u0027s red hair meant she was a witch, and if they molested her, their \u0027\u0027doodles\u0027\u0027 would shrivel up between their legs and fall off. Daisy had assured her that no man would risk losing his \u0027\u0027doodle\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Lexi George, \u0027Demon Hunting in Dixie\u0027, Brava Books (2011), ISBN 9780758263094, [http://books.google.com/books?id\u003dWBrD0T2BukoC\u0026amp;pg\u003dPT69\u0026amp;dq\u003d%22doodle%22 unnumbered page\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"All of Dwight\u0027s parts wandered, especially his \u0027\u0027doodle\u0027\u0027. He had the wandering-est \u0027\u0027doodle\u0027\u0027 in three states. His \u0027\u0027doodle\u0027\u0027 had its own set of legs. His \u0027\u0027doodle\u0027\u0027 was hardly at home. Heck, according to rumor Dwight Farris\u0027s \u0027\u0027doodle\u0027\u0027 was hardly ever in his \u0027pants\", \"priority\":19}]}, \"synonyms\":{}}");

