	add("doofus", "{\"term\":\"doofus\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\"], \"text\":\"Perhaps from German \u0027doof\u0027 (stupid) from Low German where it originally means \u0026quot;deaf\u0026quot;; akin to English \u0027deaf\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person with poor judgment and taste\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Stocks Genius or Dot-Com Doofus?\u0027 – Wired New\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Danny is such a doofus\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, w:Ann Ann Rule, \u0027In the Name of Love\u0027, in \u0027In the Name of Love and Other True Cases: Ann Rule\u0027s Crime Files Volume 4\u0027, [https://books.google.com.au/books?id\u003dzb8Bqft2wuQC\u0026amp;pg\u003dPA185\u0026amp;dq\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;f\u003dfalse page 185\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Nichols had called Bonilla a \u0027\u0027doofus\u0027\u0027 who was too damn stupid to realize that he was being taken by a hooker with a convincing sob story\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Even if Steve was a \u0027\u0027doofus\u0027\u0027, Nichols and Rand were quite willing to work for him as long as he had money\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Roger L. Welsch, \u0027Love, Sex and Tractors\u0027, [https://books.google.com.au/books?id\u003d9XRf-gHQmtQC\u0026amp;pg\u003dPA16\u0026amp;dq\u003d%22doofuses%22%7C%22doofi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doofuses%22%7C%22doofi%22\u0026amp;f\u003dfalse page 16\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"They weren\u0027t excited about acquiring new information; they were relieved to find out they aren\u0027t the only \u0027\u0027doofuses\u0027\u0027 (or maybe the word is \u0026quot;\u0027\u0027doofi\u0027\u0027\u0026quot;) in the world of rusty machinery\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 October 17, Kevin Amorin, \u0027Mewsday\u0027, quoted in \u0027\u00272007\u0027\u0027, Troth Wells, \u0027T-Shirt\u0027, [https://books.google.com.au/books?id\u003dTFk0v5oFLMUC\u0026amp;pg\u003dPA14\u0026amp;dq\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;f\u003dfalse page 14\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Being too young to attend a show on Bowie\u0027s 1983 Serious Moonlight tour, I did what any underage \u0027\u0027doofus\u0027\u0027 would do. I bought a concert T-shirt – three-quarter-length blue sleeves, image of Major Tom himself on the front\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, B. K. Holway, \u0027When Jack Was with Us\u0027, [https://books.google.com.au/books?id\u003dtP5Ovubo6RsC\u0026amp;pg\u003dPA115\u0026amp;dq\u003d%22doofuses%22%7C%22doofi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doofuses%22%7C%22doofi%22\u0026amp;f\u003dfalse page 115\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"quot;I never \u0027\u0027seen\u0027\u0027 so many \u0027\u0027doofuses\u0027\u0027 in one place!\u0026quot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"quot;That\u0027s \u0027\u0027doofi\u0027\u0027, Krakauer. Sorry to correct you.\u0026quot\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, G. Richard Bozarth, \u0027Bible Tales for Ages 18 and Up\u0027, [https://books.google.com.au/books?id\u003dnCOvBAAAQBAJ\u0026amp;pg\u003dPA219\u0026amp;dq\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22doofus%22%7C%22doofuses%22%7C%22doofi%22\u0026amp;f\u003dfalse page 219\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"quot;No problem. You get a bimbo babe who\u0027s engaged to a \u0027\u0027doofus\u0027\u0027 who will fall for the virgin birth line and still marry her.However, I don\u0027t think a \u0027\u0027doofus\u0027\u0027 fiancé will be hard to find; there\u0027s no shortage of \u0027\u0027doofuses\u0027\u0027 on the earth.\u0026quot\", \"priority\":20}]}, \"synonyms\":{}}");

