	add("doomsayer", "{\"term\":\"doomsayer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|doom|sayer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes dire predictions about the future; one who predicts doom\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Frank Herbert, \u0027New world or no world\u0027, page 141\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even from the \u0027\u0027doomsayers\u0027\u0027 you hear reflections of hope. Nobody wants \u0026quot;it\u0026quot; to happen. In his darkest moments, man is aware that, while he may be limited, humankind need not be\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, John R. Gribbin, Stephen H. Plagemann, \u0027Beyond the Jupiter effect\u0027, page 76\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"4: THE \u0027\u0027DOOMSAYERS\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"So many people have written so many books and articles forecasting doom at the end of the twentieth century that we cannot possibly do credit to all of them here\", \"priority\":6}]}, \"synonyms\":{}}");

