	add("doomwatch", "{\"term\":\"doomwatch\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|doom|watch|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pessimistic outlook on the future\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027, W T S Gould, Richard Lawton, \u0027Planning for Population Change\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"using linear projections of current high levels of population growth and consumption of raw materials produced \u0027\u0027doomwatch\u0027\u0027 forecasts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Nancy Jack Todd, \u0027A Safe and Sustainable World: The Promise of Ecological Design\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Yet however essential it may have been to changing assumptions about energy use, protest and \u0027\u0027doomwatch\u0027\u0027 activism was never New Alchemy\u0027s primary focus\", \"priority\":5}]}, \"synonyms\":{}}");

