	add("doorstep", "{\"term\":\"doorstep\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"door + step\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Step of a door. The threshold of a doorway\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d10|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dWith a little manœuvring they contrived to meet on the \u0027\u0027doorstep\u0027\u0027 which was […] in a boiling stream of passers-by, hurrying business people speeding past in a flurry of fumes and dust in the bright haze\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s immediate neighbourhood or locality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A big slice of bread\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003, Diana Wynne Jones, The Merlin Conspiracy\u0026quot;, P 241 ISBN 0-06-052318\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;I cut myself a \u0027\u0027doorstep\u0027\u0027 of bread with masses of butter and went along to see Romanov while I was eating it.\u0026quot\", \"priority\":6}]}, \"synonyms\":{}}");

	add("doorstop", "{\"term\":\"doorstop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|door|stop|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any device or object used to halt the motion of a door, as a large or heavy object, a wedge, or some piece of hardware fixed to the floor, door or wall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large book, which by implication could be used to stop a door\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Jack Hitt, \u0027Is Sarah Palin Porn?\u0027, Laura Flanders (editor), \u0027At The Tea Party: The Wing Nuts, Whack Jobs and Whitey-Whiteness of the New Republican Right... and Why We Should Take It Seriously\u0027, %22doorstops%22+politician\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d28NET8nbIoyXmQWJrrSDBA\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"%22doorstops%22%20politician\u0026amp;f\u003dfalse page 206\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Meanwhile, all the Democrats had to put forward that year was a \u0027\u0027doorstop\u0027\u0027 called \u0027Man of the House: The Life and Political Memoirs of Speaker Tip O\u0027Neill\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"in error for doorstep) A thick sandwich\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An interview with a politician or other public figure (apparently informal or spontaneous but often planned), as they enter or leave a building\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Mark Mark Latham, \u0027The Latham Diaries\u0027, %22doorstops%22+politician\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d28NET8nbIoyXmQWJrrSDBA\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22doorstops%22%20politician\u0026amp;f\u003dfalse page 106\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"And television dominates this place — just look at Beazley tossing around cans of tomato soup at his morning \u0027\u0027doorstops\u0027\u0027 outside Parliament House\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Troy Bramston, \u0027The Wran Era\u0027, %22doorstops%22+politician\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dOchET8_OF7G0iQeah6GVAw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"%22doorstops%22%20politician\u0026amp;f\u003dfalse page 244\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The six o′clock news was regarded as the pivotal point in the day. As the news was beginning, often the Premier would make himself available for a \u0027\u0027doorstop\u0027\u0027 press conference\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Anne Tiernan, Patrick Weller, \u0027Learning to Be a Minister: Heroic Expectations, Practical Realities\u0027, %22doorstops%22+politician\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dO8tET_W1COrFmQWOlMCkBA\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22doorstops%22%20politician\u0026amp;f\u003dfalse page 218\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"It was estimated, for example, that Treasurer Wayne Swan had given more than 250 interviews and \u0027\u0027doorstops\u0027\u0027 by the end of his first year in office\", \"priority\":16}]}, \"synonyms\":{}}");

