	add("doozy", "{\"term\":\"doozy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Perhaps from daisy (the flower), the name of Italian Actress w:Eleonora Duse|Eleonora Duse, or the w:Duesenberg|Duesenberg automobile manufacturer.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"something that is extraordinary. Often used in the context of troublesome, difficult or problematic, but can be used positively as well\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Most of the test was easy, but the last question was a \u0027\u0027doozy\", \"priority\":2}]}, \"synonyms\":{}}");

	add("doozie", "{\"term\":\"doozie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"American. Earlier seen also as \u0027\u0027dozy\u0027\u0027. From the flower named daisy, English slang from the eighteenth century on, for something that was particularly appealing or excellent. It moved into North American English in the early nineteenth century and turns up, for example, in Thomas Chandler Haliburton’s \u0027The Clockmaker\u0027 of 1836: \u0026quot;I raised a four year old colt once, half blood, a perfect picture of a horse, and a genuine clipper, could gallop like the wind; a real daisy, a perfect doll, had an eye like a weasel, and nostrils like Commodore Rodgers’s speakin’ trumpet\u0026quot;. Often attributed in folk etymology to \u0026quot;Duesie\u0026quot;, a nickname for the early-Twentieth-Century American luxury automobile, Duesenberg, but this is certainly false as the term predates the automobile.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"something that is extraordinary. Often used in the context of troublesome, difficult or problematic, but can be used positively as well\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Most of the test was easy, but the last question was a \u0027\u0027doozie\", \"priority\":2}]}, \"synonyms\":{}}");

